* {
  box-sizing: border-box;
}
.main-container {
  display: flex;
  width: 100%;
  height: 100%;
  padding: 10px;
  gap: 20px;
  background: #f5f5f5;
}
.canvas-container,
.svg-container,
.webgl-container {
  flex: 1;
  display: flex;
  flex-direction: column;
  background: white;
  border-radius: 8px;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
  padding: 10px;
  overflow: hidden;
}
.visual-title {
  margin: 0 0 10px 0;
  padding: 0;
  font-size: 16px;
  font-weight: 600;
  color: #333;
  text-align: center;
  border-bottom: 2px solid #e0e0e0;
  padding-bottom: 8px;
}
canvas {
  display: block;
  max-width: 100%;
  max-height: 100%;
}
.webgl-canvas {
  display: block;
  max-width: 100%;
  max-height: 100%;
  background: #333;
}
.webgl-text {
  display: flex;
  align-items: center;
  justify-content: center;
  flex: 1;
  font-size: 18px;
  font-weight: bold;
  color: #f44336;
  text-align: center;
}
.d3-svg {
  display: block;
  max-width: 100%;
  max-height: 100%;
}
.d3-svg .arc {
  cursor: pointer;
}
.d3-svg .arc path {
  transition: all 0.2s ease;
}
.d3-svg .legend .legend-item {
  cursor: pointer;
}
.d3-svg .legend .legend-item:hover {
  opacity: 0.8;
}


